import React, {Component} from 'react';

import './Welcome.css';
import ReactDOM from 'react-dom';
import axios from 'axios';

class Welcome extends React.Component {
  state = {
    data: []
  }

  componentDidMount() {
    fetch('./play.json')
    .then(res => res.json())
    .then((data) => {
      this.setState({ data: data })
    
    })
    .catch(console.log)
  }
 render() {
const data = this.state.data && this.state.data.assets ? this.state.data.assets :[];
    return (
       <div className="container">
        <div className="col-xs-12">
        <h1>My Data</h1>
       data.map((data,index) => {
      (
           <ul key={data}>
        <li>{data.filename}</li>
</ul>
       )
    })

        </div>
       </div>
    );
  }
}
export default Welcome;
